// recommendation functions

	function initiateRecommendations(recommendationsArray){

		for(var i = 0; i < recommendationsArray.length; i++){

			var owl = $(recommendationsArray[i]);

			if($(recommendationsArray[i] + ' > .item').length > 1){
			
				owl.owlCarousel({
					items:1,
					loop:true,
					margin:100,
					autoplay:false,
					mouseDrag:false,
					autoplayTimeout:5500,
					autoplayHoverPause:true,
					smartSpeed: 250,
					dotsContainer: recommendationsArray[i] + '-dots-box',
					navText: '',
					navContainer: recommendationsArray[i] + '-nav-box'
				});
			
			}
			else{
				owl.owlCarousel({
				items:1,
					loop:false,
					nav:false,
					mouseDrag:false,
					margin:100,
				});
			}

		}

		positionQvButton();

	}

	function initiateVerticalRecommendations(recommendationsArray){
		// will be added at a later date
	}

	// ui
	function positionQvButton(){
		$('.v4-recs-quickview-button')
		.css('margin-top', '-' + $('.v4-recs-quickview-button:first').outerHeight()/2 + 'px')
		.css('margin-left', '-' + $('.v4-recs-quickview-button:first').outerWidth()/2 + 'px');
	}

// end recommendation functions



// input functions

	// set value
	function setInputValue(whichInput, newValue){
		$(whichInput).val(newValue);
		$(whichInput + '-error').hide();
	}

	function checkInputValue(whichInput, inputValue, multiplesOf){
		(parseInt(inputValue) % parseInt(multiplesOf) !== 0 ) ? $(whichInput + '-error').show() : $(whichInput + '-error').hide();
		$(whichInput).focus();
	}

// end input functions



// recommendation modal functions
// mt note: please put correct ajax URL in functions below
	
	function recommendationQuickView(itemSpecifics){
		
		$.fancybox.open({
			src  : 'url.com/ajax-here?' + itemSpecifics,
			type : 'ajax'
		});
		
	}
	
	function recommendationAddToCart(itemSpecifics){
		
		$.fancybox.open({
			src  : 'url.com/ajax-here?' + itemSpecifics,
			type : 'ajax'
		});
		
	}
	
// end recommendation modal functions



$(document).ready(function(){
	//$('#main-header-sub').prepend(mobileHeader);
	
	// tn qty functions
	
		// enable semantic dropsown
		$('.v4-qty-chooser-dropdown').dropdown();

		// check input value for correct multiples
		$('.v4-qty-chooser-input').on('change', function(){
			checkInputValue('#' + $(this).attr('id'), $(this).val(), $(this).attr('value'));
		});
	
	// end tn qty functions
		try{                       
			// put each unique slider ID into this array the call and pass array to initiateRecommendations()
			var 
			recommendationsBloomReachArray = [
			'#owl-carousel-br'
			];
	 
		initiateRecommendations(recommendationsBloomReachArray);
		$('[br-modal]').fancybox({
			 touch : false
		});
		}catch(err){}
	
});

function clickoutsidefancy() {
			  $.fancybox.defaults.mobile = {
                clickSlide: function (current, event) {
                    return current.type === 'image' ? 'toggleControls' : false;
                }
            }
			
		}

$(window).resize(function () {
		    clickoutsidefancy();
			 if ($(window).width() >= 992) {
                $(".pushable").click();
            }
		});

$(window).on("load",function () {
           clickoutsidefancy();
        });